USE table_handler;


If DB_ID(N'data') IS NOT NULL
	DROP TABLE data;
	
CREATE TABLE data (col0 INTEGER,col1 INTEGER,col2 INTEGER,col3 INTEGER,col4 INTEGER,col5 INTEGER,col6 INTEGER,col7 INTEGER,col8 INTEGER,col9 INTEGER);
DROP TABLE IF EXISTS data_s;
CREATE TABLE data_s (col0 VARCHAR(255), col1 VARCHAR(255), col2 VARCHAR(255), col3 VARCHAR(255), col4 VARCHAR(255), col5 VARCHAR(255), col6 VARCHAR(255), col7 VARCHAR(255), col8 VARCHAR(255), col9 VARCHAR(255));
DROP TABLE IF EXISTS data_f;
CREATE TABLE data_f (col0 REAL, col1 REAL, col2 REAL, col3 REAL, col4 REAL, col5 REAL, col6 REAL, col7 REAL, col8 REAL, col9 REAL);
DROP TABLE IF EXISTS data_m;
CREATE TABLE data_m (coli INTEGER, colf REAL, cols VARCHAR(255));
